/* Pallete to test new combinations with
	rgb(147,223,184)
	rgb(235,220,200)
	rgb(238,237,219)
	rgb(227,170,214)
	rgb(181,216,235)
	rgb(238,242,230)
	rgb(255,237,201)
	rgb(255,200,186)
	rgb(37,41,42)
	rgb(161,219,178)
	rgb(230,230,220)
	rgb(218,221,251)
	rgb(248,218,251)
	rgb(255,171,171)
	rgb(15,219,159)
	rgb(218,251,248)
	rgb(221,229,254)
	rgb(226,255,230)
*/
.github-RecentCommits {
  max-height: 89px;
  overflow-x: hidden;
  overflow-y: auto;
  border-top: 1px solid rgba(0, 0, 0, 0.5);
}
.github-RecentCommits-list {
  margin: 0;
  padding: 5px 0;
  list-style: none;
}
.github-RecentCommits-message {
  padding: 5px 10px;
  text-align: center;
  color: #555;
}
.github-RecentCommit {
  position: relative;
  display: flex;
  align-items: center;
  padding: 0 10px;
  line-height: 26px;
}
.github-RecentCommit-authors {
  position: absolute;
  display: flex;
}
.github-RecentCommit-avatar {
  position: relative;
  margin-right: -13px;
  width: 16px;
  height: 16px;
  border-radius: 2px;
  color: transparent;
  background-color: #3c3f41;
  box-shadow: 1px 0 #292c2f;
  overflow: hidden;
  transition: margin 0.12s cubic-bezier(0.5, 0.1, 0, 1);
}
.github-RecentCommit-avatar:nth-child(1) {
  z-index: 3;
}
.github-RecentCommit-avatar:nth-child(2) {
  z-index: 2;
  opacity: .7;
}
.github-RecentCommit-avatar:nth-child(3) {
  z-index: 1;
  opacity: .4;
}
.github-RecentCommit-avatar:nth-child(n+4) {
  display: none;
}
.github-RecentCommit-avatar:only-child,
.github-RecentCommit-avatar:last-child {
  box-shadow: none;
}
.github-RecentCommit-authors:hover .github-RecentCommit-avatar {
  display: inline-block;
  margin-right: 1px;
  opacity: 1;
}
.github-RecentCommit-message {
  flex: 1;
  margin: 0 .5em;
  margin-left: 26px;
  text-overflow: ellipsis;
  white-space: nowrap;
  overflow: hidden;
}
.github-RecentCommit-undoButton.btn {
  padding: 0 6.66666667px;
  margin-right: 5px;
  height: 20px;
  line-height: 1;
  font-size: .9em;
}
.github-RecentCommit-time {
  color: #555;
}
.github-RecentCommit:hover {
  color: #fff;
  background: rgba(255, 255, 255, 0.07);
}
.github-RecentCommit.is-selected {
  color: #fff;
  background: #4182C4;
}
.github-RecentCommits:focus .github-RecentCommit.is-selected {
  color: #ffffff;
  background: #5c6064;
}
@media (min-height: 900px) {
  .github-RecentCommits {
    max-height: 141px;
  }
}
@media (min-height: 1200px) {
  .github-RecentCommits {
    max-height: 271px;
  }
}
